import { Modal, Button, Form, Input, Divider } from "antd";
import { MailOutlined, LockOutlined } from "@ant-design/icons";

import authService from "../utils/authentication";

import { message } from "antd";
import courseApi from "../api/course";

interface AddCourseModalProps {

  toggleAddCourseModal: () => void;

}

const AddCourseModal: React.FC<AddCourseModalProps> = ({toggleAddCourseModal}) => {
  const onFormFinish = (addCourseValues) => {
    console.log(addCourseValues.coursename);
    courseApi.addCourse(addCourseValues.coursename);
  };

  return (
    <>
      <Modal
        visible={true}
        title={<div style={{ textAlign: "center" }}>LOGIN</div>}
        centered
        onCancel={() => toggleAddCourseModal}
        footer={null}
      >
        <Form
          name="add_course"
          className="addCourse-form"
          initialValues={{}}
          onFinish={onFormFinish}
        >
          <Form.Item
            name="coursename"
            rules={[
              { required: true, message: "Please enter a course name!" }
            ]}
          >
            <Input prefix={<MailOutlined />} placeholder="School Name" />
          </Form.Item>
          <Form.Item>
            <Button
              type="primary"
              htmlType="submit"
              style={styles.loginFormButton}
            >
              LOG IN
            </Button>
          </Form.Item>
        </Form>
      </Modal>
    </>
  );
};

const styles = {
  loginFormButton: {
    width: "100%",
    backgroundColor: "#2D538C",
  },
};

export default AddCourseModal;
